import React from 'react';
import './header.css';
import { Row, Col, Container } from 'react-bootstrap';
import Button from 'react-bootstrap/Button';

const Header = () => {
	return (
		<Container className="headerCont">
			<Row className="header">
                <ol></ol>
			</Row>
		</Container>
	);
};
export default Header;
